    super(props)
    this.state = {
      items: {
        id: 1,
        title: 'Стул серый',
        img: 'chair-grey.jpeg',
        desc: '    Lorem ipsum dolor sit amet consectetur adipisicing.',
        category: 'chairs'
      }
    }
  }
  render() {
    return (
    <div className="wrapper">
      <Header />
      <Footer />
    </div>
    )
  };
}

export default App;
